import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Display = () => {
  const [images, setImages] = useState([]);

  useEffect(() => {
    fetchImages();
  }, []);

  const fetchImages = async () => {
    try {
      const token = localStorage.getItem('auth-token'); // Get the authentication token from local storage
      const response = await axios.post('/displayimages', {}, {
        headers: {
          'auth-token': token // Send the token with the request
        }
      });
      setImages(response.data);
    } catch (error) {
      console.error('Error fetching images:', error);
    }
  };

  return (
    <div>
      <h1>Display Images</h1>
      <div>
        {images.map((image, index) => (
          <img key={index} src={image.imageUrl} alt={`Image ${index}`} />
        ))}
      </div>
    </div>
  );
};

export default Display;
